def max_element(l: list):
    """Return maximum element in the list.
    >>> max_element([1, 2, 3])
    3
    >>> max_element([5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10])
    123
    """
    if not l:
        return None
    if len(l) == 1:
        return l[0]
    else:
        m = l[0]
        for e in l[1:]:
            if e > m:
                m = e
        return m

def max_element(l: list):
    """Return maximum element in the list.
    >>> max_element([1, 2, 3])
    3
    >>> max_element([5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10])
    123
    """
    if not l:
        return None
    elif len(l) == 1:
        return l[0]
    else:
        return max(l[1:], key=lambda x: x > l[0])

def max_element(l: list):
    """Return maximum element in the list.
    >>> max_element([1, 2, 3])
    3
    >>> max_element([5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10])
    123
    """
    def comparator(item):
        if item > l[-1]:
            l[-1] = item
        return item
    return max(l, key = comparator)

