    >>> max_element([1, 2, 3])
    3
    >>> max_element([5, 3, -5, 2, -3, 3, 9, 0, 123, 1, -10])
    123
    """
    # First try to return the last element if the list is not empty
    if not l:
        return l[0]

    # If the last element is the maximum element, return it
    if l[-1] > l[-2]:
        return l[-1]

    # If the last two elements are the maximum, return the last two elements
    elif l[-2] > l[-3]:
        return l[-2:]

    # Otherwise, recursively apply the same logic to the tail of the list
    else:
        return max_element(l[:-1])

